import React from 'react';
import ReactDOM from 'react-dom';
import { BrouserRouter } from 'react-router-dom';
import './index.css';
import App from './App';
import registerServiceWorker from './registerServiceWorker';

ReactDOM.render(
    <BrouserRouter>
        <App />
    </BrouserRouter>,
    document.getElementById('root'));
registerServiceWorker();
